    false,nt"url": null,nt"notes": "This EnviroAtlas web service supports research
    and online mapping activities related to EnviroAtlas (https://www.epa.gov/enviroatlas).
    The Food, Fuel, and Materials category in this web service includes layers illustrating
    the ecosystems and natural resources that provide or support the production of food,
    fuel, or other materials, the need or demand for these items, the impacts associated
    with their presence and accessibility, and factors that place stress on the natural
    environment's capability to provide these benefits. EnviroAtlas allows the user
    to interact with a web-based, easy-to-use, mapping application to view and analyze
    multiple ecosystem services for the conterminous United States. Additional descriptive
    information about each attribute in this web service is located within each web
    service layer (see Full Metadata hyperlink) or can be found in its associated EnviroAtlas
    Fact Sheet (https://www.epa.gov/enviroatlas/enviroatlas-fact-sheets).",nt"license_title":
